import styled from 'styled-components'
export const Container = styled.div`
  position: fixed;
  display: flex;
  width: 330px;
  height: 80px;
  background: white;
  border: 1px solid lightblue;
  bottom: 0;
  right: 20px;
  align-items: center;
`

export const Img = styled.img`
  width: 60px;
  height: 60px;
  border-radius: 50%;
`
